// ==UserScript==
// @match        https://nhentai.net/*
// ==/UserScript==

(function () {
    'use strict';
    function addJQuery(callback) {
        var script = document.createElement("script");
        script.setAttribute("src", "https://code.jquery.com/jquery-3.5.1.min.js");
        script.addEventListener('load', function () {
            var script = document.createElement("script");
            script.textContent = "(" + callback.toString() + ")();";
            document.body.appendChild(script);
        }, false);
        document.body.appendChild(script);
    }

    // the guts of this userscript
    function main() {
        console.log('nhenta userscript loaded');
        // Begin Definiing Images
        var pinkSortImageElement = "<img alt='Download' height='20' width='20' src='data:image/png;base64,' />";

        var unfavoriteimage = "<img alt='Un-Favorite' height='20' width='20' src='data:image/jpeg;base64,' />";

        var favoriteImage = '<img alt="Favorite" height="20" width="20" src=" data:image/jpeg;base64,"/>';

        var downloadImage = '<img alt="Download" height="20" width="20" src="data:image/jpeg;base64,"/>';
        // End definiing images


        if (window.jQuery === undefined) {
            throw "JQuery not loaded, exiting userscript.";
        }
        else {
            let mangaIndexes = [];
            jQuery('div.gallery').each(function (index, element) {
                var galleryElement = jQuery(element)
                var elem = galleryElement.find('a.cover')

                var galleryLink = elem.attr('href');
                var mangaGalleryId = galleryLink.split('/')[2]

                mangaIndexes.push({
                    galleryDom: galleryElement,
                    coverDom: elem,
                    mangaGalleryId: mangaGalleryId
                });

                var favoriteId = "anchor_favorite_" + mangaGalleryId;
                var unfavoriteId = "anchor_unfavorite_" + mangaGalleryId;
                var downloadLink = '/g/' + mangaGalleryId + '/download';

                var downloadAndFavoriteHtml = "<div class='userscript_bar' style='height:20px;width:200px;clear:both'>"
                    + "<div class='userscript_bar_download' style='float:left;width:25px;height:20px;'><a href='" + downloadLink + "'>" + downloadImage + "</a></div>"
                    + "<div class='userscript_bar_favourite' style='float:left;width:25px;height:20px;'><a id='" + favoriteId + "' href='javascript:void(0);'>" + favoriteImage + "</a></div>"
                    + "<div class='userscript_bar_unfavourite' style='float:left;width:25px;height:20px;'><a id='" + unfavoriteId + "' href='javascript:void(0);'>" + unfavoriteimage + "</a></div>"
                    + "</div>";

                elem.after(jQuery(downloadAndFavoriteHtml));

                jQuery('#' + favoriteId).click(function () {
                    jQuery.ajax({
                        url: '/api/gallery/' + mangaGalleryId + '/favorite',
                        type: 'post',
                        data: { favorited: true },
                        headers: { 'X-CSRFToken': window.n.options.csrf_token },
                        dataType: 'json',
                        success: function (data) { console.log(data) },
                        failure: function (data) { console.log(data) }
                    });
                });

                jQuery('#' + unfavoriteId).click(function () {
                    jQuery.ajax({
                        url: '/api/gallery/' + mangaGalleryId + '/unfavorite',
                        type: 'post',
                        data: { favorited: false },
                        headers: { 'X-CSRFToken': window.n.options.csrf_token },
                        dataType: 'json',
                        success: function (data) { console.log(data) },
                        failure: function (data) { console.log(data) }
                    });
                });
            });



            function processPageCount(response, index, mangaIndexes) {
                console.log(index)
                var html = jQuery.parseHTML(response);
                var dom = jQuery(html);
                var pageCount = dom.find('div.tag-container.field-name:contains("Pages")>span>a>span').text()

                var galleryDom = mangaIndexes[index].galleryDom;

                console.log(pageCount);
                console.log(galleryDom);

                galleryDom.find('div.userscript_bar').append('<div class="userscript_bar_pageCount" style="float:left;width:25px;height:20px;"><span>' + pageCount + '</span></div>')
            }

            function getPageHttp(mangaIndexes, index) {
                let galleryId = mangaIndexes[index].mangaGalleryId;
                console.log('Making http call for galleryId:' + galleryId)
                return jQuery.get('/g/' + galleryId)
                    .done(function (response) {
                        processPageCount(response, index, mangaIndexes)
                    })
            }

            function processQueue(mangaIndexes, parallelLimit) {
                let ongoingCalls = 0;
                let currentIndex = 0;

                function next() {
                    if (currentIndex >= mangaIndexes.length && ongoingCalls === 0) {
                        console.log("All calls completed");
                        return;
                    }

                    while (ongoingCalls < parallelLimit && currentIndex < mangaIndexes.length) {

                        console.log('Before making http call, index:' + currentIndex);
                        getPageHttp(mangaIndexes, currentIndex)
                            .always(function() {
                                ongoingCalls--;
                                next();
                            });

                        currentIndex++;
                        ongoingCalls++;
                    }
                }
                next();
            }
            processQueue(mangaIndexes, 3);
        }
    }
    // load jQuery and execute the main function
    addJQuery(main);
})();